import React from 'react';
import "./Nav.css" ; 

function Nav() {
    return (
        <div className="nav">
 
              <div className="nav__contents" >
                  < img className="nav__logo"  src ="https://www.designmantic.com/blog/wp-content/uploads/2016/07/Netflix-Logo.png" alt ="" /> 
                        
                  < img className="nav__avatar" src ="data:image/png;base64," alt ="" /> 
       
              </div>

    
       </div>
    )
}

export default Nav
